"use strict";(self.webpackChunk=self.webpackChunk||[]).push([["5202"],{8166:function(s,n,a){a.r(n),a.d(n,{default:function(){return l}});var t=a(1147);let e=["innerHTML"],l={setup:()=>({html:""}),render:()=>((0,t.wg)(),(0,t.iD)("div",{class:"mi-doc-markdown-body",innerHTML:'<h1>TimePicker 时间选择</h1>\n<div class="mi-doc-card"><h3 id="jie-shao" tabindex="-1">介绍</h3>\n<p>时间选择器，通常与<a href="#/zh-CN/popup" target="_blank">弹出层</a>组件配合使用。</p>\n</div><div class="mi-doc-card"><h3 id="yin-ru" tabindex="-1">引入</h3>\n<p>通过以下方式来全局注册组件，更多注册方式请参考<a href="#/zh-CN/advanced-usage#zu-jian-zhu-ce" target="_blank">组件注册</a>。</p>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { createApp } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> { <span class="hljs-title class_">TimePicker</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n\n<span class="hljs-keyword">const</span> app = <span class="hljs-title function_">createApp</span>();\napp.<span class="hljs-title function_">use</span>(<span class="hljs-title class_">TimePicker</span>);\n</code></pre>\n</div><h2 id="dai-ma-yan-shi" tabindex="-1">代码演示</h2>\n<div class="mi-doc-card"><h3 id="ji-chu-yong-fa" tabindex="-1">基础用法</h3>\n<p>通过 <code>v-model</code> 绑定当前选中的时间。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-time-picker</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentTime&quot;</span> <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;选择时间&quot;</span> /&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> currentTime = <span class="hljs-title function_">ref</span>([<span class="hljs-string">&#x27;12&#x27;</span>, <span class="hljs-string">&#x27;00&#x27;</span>]);\n        <span class="hljs-keyword">return</span> { currentTime };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="xuan-xiang-lei-xing" tabindex="-1">选项类型</h3>\n<p>通过 <code>columns-type</code> 属性可以控制选项的类型，支持以任意顺序对 <code>hour</code>、<code>minute</code> 和 <code>second</code> 进行排列组合。</p>\n<p>比如：</p>\n<ul>\n<li>传入 <code>[\'hour\']</code> 来单独选择小时。</li>\n<li>传入 <code>[\'minute\']</code> 来单独选择分钟。</li>\n<li>传入 <code>[\'minute\', \'second\']</code> 来选择分钟和秒。</li>\n<li>传入 <code>[\'hour\', \'minute\', \'second\']</code> 来选择小时、分钟和秒。</li>\n</ul>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-time-picker</span>\n    <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentTime&quot;</span>\n    <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;选择时间&quot;</span>\n    <span class="hljs-attr">:columns-type</span>=<span class="hljs-string">&quot;columnsType&quot;</span>\n/&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> currentTime = <span class="hljs-title function_">ref</span>([<span class="hljs-string">&#x27;12&#x27;</span>, <span class="hljs-string">&#x27;00&#x27;</span>, <span class="hljs-string">&#x27;00&#x27;</span>]);\n        <span class="hljs-keyword">const</span> columnsType = [<span class="hljs-string">&#x27;hour&#x27;</span>, <span class="hljs-string">&#x27;minute&#x27;</span>, <span class="hljs-string">&#x27;second&#x27;</span>];\n        <span class="hljs-keyword">return</span> {\n            currentTime,\n            columnsType,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="shi-jian-fan-wei" tabindex="-1">时间范围</h3>\n<p>你可以使用 <code>min-hour</code> 和 <code>max-hour</code> 等属性来限制小时（hour）范围、分钟（minute）范围和秒（second）范围。</p>\n<p>比如以下示例，用户可以选择的小时是 <code>10 ~ 20</code> ，分钟是 <code>30 ~ 40</code>。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-time-picker</span>\n    <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentTime&quot;</span>\n    <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;选择时间&quot;</span>\n    <span class="hljs-attr">:min-hour</span>=<span class="hljs-string">&quot;10&quot;</span>\n    <span class="hljs-attr">:max-hour</span>=<span class="hljs-string">&quot;20&quot;</span>\n    <span class="hljs-attr">:min-minute</span>=<span class="hljs-string">&quot;30&quot;</span>\n    <span class="hljs-attr">:max-minute</span>=<span class="hljs-string">&quot;40&quot;</span>\n/&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> currentTime = <span class="hljs-title function_">ref</span>([<span class="hljs-string">&#x27;12&#x27;</span>, <span class="hljs-string">&#x27;35&#x27;</span>]);\n        <span class="hljs-keyword">return</span> { currentTime };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="zheng-ti-shi-jian-fan-wei" tabindex="-1">整体时间范围</h3>\n<p>你可以使用 <code>min-time</code> 和 <code>max-time</code> 属性来限制整体时间范围，约定格式 <code>10:00:00</code>。</p>\n<ul>\n<li>设置 <code>min-time</code> 后，<code>min-hour</code>、<code>min-minute</code>、<code>min-second</code> 属性将不会生效。</li>\n<li>设置 <code>max-time</code> 后，<code>max-hour</code>、<code>max-minute</code>、<code>max-second</code> 属性将不会生效。</li>\n</ul>\n<p>比如以下示例，用户可以选择从 <code>09:40:10</code> 到 <code>20:20:50</code> 的任意时间。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-time-picker</span>\n    <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentTime&quot;</span>\n    <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;选择时间&quot;</span>\n    <span class="hljs-attr">:columns-type</span>=<span class="hljs-string">&quot;[&#x27;hour&#x27;, &#x27;minute&#x27;, &#x27;second&#x27;]&quot;</span>\n    <span class="hljs-attr">min-time</span>=<span class="hljs-string">&quot;09:40:10&quot;</span>\n    <span class="hljs-attr">max-time</span>=<span class="hljs-string">&quot;20:20:50&quot;</span>\n/&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> currentTime = <span class="hljs-title function_">ref</span>([<span class="hljs-string">&#x27;12&#x27;</span>, <span class="hljs-string">&#x27;00&#x27;</span>, <span class="hljs-string">&#x27;00&#x27;</span>]);\n        <span class="hljs-keyword">return</span> { currentTime };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="ge-shi-hua-xuan-xiang" tabindex="-1">格式化选项</h3>\n<p>通过传入 <code>formatter</code> 函数，可以对选项的文字进行格式化。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-time-picker</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentTime&quot;</span> <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;选择时间&quot;</span> <span class="hljs-attr">:formatter</span>=<span class="hljs-string">&quot;formatter&quot;</span> /&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> currentTime = <span class="hljs-title function_">ref</span>([<span class="hljs-string">&#x27;12&#x27;</span>, <span class="hljs-string">&#x27;00&#x27;</span>]);\n        <span class="hljs-keyword">const</span> <span class="hljs-title function_">formatter</span> = (<span class="hljs-params">type, option</span>) =&gt; {\n            <span class="hljs-keyword">if</span> (type === <span class="hljs-string">&#x27;hour&#x27;</span>) {\n                option.<span class="hljs-property">text</span> += <span class="hljs-string">&#x27;时&#x27;</span>;\n            }\n            <span class="hljs-keyword">if</span> (type === <span class="hljs-string">&#x27;minute&#x27;</span>) {\n                option.<span class="hljs-property">text</span> += <span class="hljs-string">&#x27;分&#x27;</span>;\n            }\n            <span class="hljs-keyword">return</span> option;\n        };\n\n        <span class="hljs-keyword">return</span> {\n            formatter,\n            currentTime,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="guo-lu-xuan-xiang" tabindex="-1">过滤选项</h3>\n<p>通过传入 <code>filter</code> 函数，可以对选项数组进行过滤，剔除不需要的时间，实现自定义时间间隔。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-time-picker</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentTime&quot;</span> <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;选择时间&quot;</span> <span class="hljs-attr">:filter</span>=<span class="hljs-string">&quot;filter&quot;</span> /&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> currentTime = <span class="hljs-title function_">ref</span>([<span class="hljs-string">&#x27;12&#x27;</span>, <span class="hljs-string">&#x27;00&#x27;</span>]);\n        <span class="hljs-keyword">const</span> <span class="hljs-title function_">filter</span> = (<span class="hljs-params">type, options</span>) =&gt; {\n            <span class="hljs-keyword">if</span> (type === <span class="hljs-string">&#x27;minute&#x27;</span>) {\n                <span class="hljs-keyword">return</span> options.<span class="hljs-title function_">filter</span>(\n                    <span class="hljs-function">(<span class="hljs-params">option</span>) =&gt;</span> <span class="hljs-title class_">Number</span>(option.<span class="hljs-property">value</span>) % <span class="hljs-number">10</span> === <span class="hljs-number">0</span>,\n                );\n            }\n            <span class="hljs-keyword">return</span> options;\n        };\n\n        <span class="hljs-keyword">return</span> {\n            filter,\n            currentTime,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="gao-ji-yong-fa" tabindex="-1">高级用法</h3>\n<p><code>filter</code> 函数的第三个参数能获取到当前选择的时间，这在使用非受控模式时，可以更灵活地过滤掉不需要的时间。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-time-picker</span> <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;选择时间&quot;</span> <span class="hljs-attr">:filter</span>=<span class="hljs-string">&quot;filter&quot;</span> /&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> <span class="hljs-title function_">filter</span> = (<span class="hljs-params">type, options, values</span>) =&gt; {\n            <span class="hljs-keyword">const</span> hour = +values[<span class="hljs-number">0</span>];\n\n            <span class="hljs-keyword">if</span> (type === <span class="hljs-string">&#x27;hour&#x27;</span>) {\n                <span class="hljs-keyword">return</span> options.<span class="hljs-title function_">filter</span>(\n                    <span class="hljs-function">(<span class="hljs-params">option</span>) =&gt;</span>\n                        <span class="hljs-title class_">Number</span>(option.<span class="hljs-property">value</span>) &gt;= <span class="hljs-number">8</span> &amp;&amp; <span class="hljs-title class_">Number</span>(option.<span class="hljs-property">value</span>) &lt;= <span class="hljs-number">18</span>,\n                );\n            }\n\n            <span class="hljs-keyword">if</span> (type === <span class="hljs-string">&#x27;minute&#x27;</span>) {\n                options = options.<span class="hljs-title function_">filter</span>(\n                    <span class="hljs-function">(<span class="hljs-params">option</span>) =&gt;</span> <span class="hljs-title class_">Number</span>(option.<span class="hljs-property">value</span>) % <span class="hljs-number">10</span> === <span class="hljs-number">0</span>,\n                );\n\n                <span class="hljs-keyword">if</span> (hour === <span class="hljs-number">8</span>) {\n                    <span class="hljs-keyword">return</span> options.<span class="hljs-title function_">filter</span>(\n                        <span class="hljs-function">(<span class="hljs-params">option</span>) =&gt;</span> <span class="hljs-title class_">Number</span>(option.<span class="hljs-property">value</span>) &gt;= <span class="hljs-number">40</span>,\n                    );\n                }\n\n                <span class="hljs-keyword">if</span> (hour === <span class="hljs-number">18</span>) {\n                    <span class="hljs-keyword">return</span> options.<span class="hljs-title function_">filter</span>(\n                        <span class="hljs-function">(<span class="hljs-params">option</span>) =&gt;</span> <span class="hljs-title class_">Number</span>(option.<span class="hljs-property">value</span>) &lt;= <span class="hljs-number">20</span>,\n                    );\n                }\n            }\n\n            <span class="hljs-keyword">return</span> options;\n        };\n\n        <span class="hljs-keyword">return</span> {\n            filter,\n        };\n    },\n};\n</code></pre>\n</div><h2 id="api" tabindex="-1">API</h2>\n<div class="mi-doc-card"><h3 id="props" tabindex="-1">Props</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>v-model</td>\n<td>当前选中的时间</td>\n<td><em>string[]</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>columns-type</td>\n<td>选项类型，由 <code>hour</code>、<code>minute</code> 和 <code>second</code> 组成的数组</td>\n<td><em>string[]</em></td>\n<td><code>[\'hour\', \'minute\']</code></td>\n</tr>\n<tr>\n<td>min-hour</td>\n<td>可选的最小小时</td>\n<td><em>number | string</em></td>\n<td><code>0</code></td>\n</tr>\n<tr>\n<td>max-hour</td>\n<td>可选的最大小时</td>\n<td><em>number | string</em></td>\n<td><code>23</code></td>\n</tr>\n<tr>\n<td>min-minute</td>\n<td>可选的最小分钟</td>\n<td><em>number | string</em></td>\n<td><code>0</code></td>\n</tr>\n<tr>\n<td>max-minute</td>\n<td>可选的最大分钟</td>\n<td><em>number | string</em></td>\n<td><code>59</code></td>\n</tr>\n<tr>\n<td>min-second</td>\n<td>可选的最小秒数</td>\n<td><em>number | string</em></td>\n<td><code>0</code></td>\n</tr>\n<tr>\n<td>max-second</td>\n<td>可选的最大秒数</td>\n<td><em>number | string</em></td>\n<td><code>59</code></td>\n</tr>\n<tr>\n<td>min-time <code>v4.5.0</code></td>\n<td>可选的最小时间，格式参考 <code>07:40:00</code>，使用时 <code>min-hour</code> <code>min-minute</code> <code>min-second</code> 不会生效</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>max-time <code>v4.5.0</code></td>\n<td>可选的最大时间，格式参考 <code>10:20:00</code>，使用时 <code>max-hour</code> <code>max-minute</code> <code>max-second</code> 不会生效</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>title</td>\n<td>顶部栏标题</td>\n<td><em>string</em></td>\n<td><code>\'\'</code></td>\n</tr>\n<tr>\n<td>confirm-button-text</td>\n<td>确认按钮文字</td>\n<td><em>string</em></td>\n<td><code>确认</code></td>\n</tr>\n<tr>\n<td>cancel-button-text</td>\n<td>取消按钮文字</td>\n<td><em>string</em></td>\n<td><code>取消</code></td>\n</tr>\n<tr>\n<td>show-toolbar</td>\n<td>是否显示顶部栏</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>loading</td>\n<td>是否显示加载状态</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>readonly</td>\n<td>是否为只读状态，只读状态下无法切换选项</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>filter</td>\n<td>选项过滤函数</td>\n<td><em>(type: string, options: PickerOption[], values: string[]) =&gt; PickerOption[]</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>formatter</td>\n<td>选项格式化函数</td>\n<td><em>(type: string, option: PickerOption) =&gt; PickerOption</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>option-height</td>\n<td>选项高度，支持 <code>px</code> <code>vw</code> <code>vh</code> <code>rem</code> 单位，默认 <code>px</code></td>\n<td><em>number | string</em></td>\n<td><code>44</code></td>\n</tr>\n<tr>\n<td>visible-option-num</td>\n<td>可见的选项个数</td>\n<td><em>number | string</em></td>\n<td><code>6</code></td>\n</tr>\n<tr>\n<td>swipe-duration</td>\n<td>快速滑动时惯性滚动的时长，单位 <code>ms</code></td>\n<td><em>number | string</em></td>\n<td><code>1000</code></td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="events" tabindex="-1">Events</h3>\n<table>\n<thead>\n<tr>\n<th>事件名</th>\n<th>说明</th>\n<th>回调参数</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>confirm</td>\n<td>点击完成按钮时触发</td>\n<td><em>{ selectedValues, selectedOptions, selectedIndexes }</em></td>\n</tr>\n<tr>\n<td>cancel</td>\n<td>点击取消按钮时触发</td>\n<td><em>{ selectedValues, selectedOptions, selectedIndexes }</em></td>\n</tr>\n<tr>\n<td>change</td>\n<td>选项改变时触发</td>\n<td><em>{ selectedValues, selectedOptions, selectedIndexes, columnIndex }</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="slots" tabindex="-1">Slots</h3>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>说明</th>\n<th>参数</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>toolbar</td>\n<td>自定义整个顶部栏的内容</td>\n<td>-</td>\n</tr>\n<tr>\n<td>title</td>\n<td>自定义标题内容</td>\n<td>-</td>\n</tr>\n<tr>\n<td>confirm</td>\n<td>自定义确认按钮内容</td>\n<td>-</td>\n</tr>\n<tr>\n<td>cancel</td>\n<td>自定义取消按钮内容</td>\n<td>-</td>\n</tr>\n<tr>\n<td>option</td>\n<td>自定义选项内容</td>\n<td><em>option: PickerOption, index: number</em></td>\n</tr>\n<tr>\n<td>columns-top</td>\n<td>自定义选项上方内容</td>\n<td>-</td>\n</tr>\n<tr>\n<td>columns-bottom</td>\n<td>自定义选项下方内容</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="fang-fa" tabindex="-1">方法</h3>\n<p>通过 ref 可以获取到 Picker 实例并调用实例方法，详见<a href="#/zh-CN/advanced-usage#zu-jian-shi-li-fang-fa" target="_blank">组件实例方法</a>。</p>\n<table>\n<thead>\n<tr>\n<th>方法名</th>\n<th>说明</th>\n<th>参数</th>\n<th>返回值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>confirm</td>\n<td>停止惯性滚动并触发 <code>confirm</code> 事件</td>\n<td>-</td>\n<td>-</td>\n</tr>\n<tr>\n<td>getSelectedTime</td>\n<td>获取当前选中的时间</td>\n<td>-</td>\n<td><em>string[]</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="lei-xing-ding-yi" tabindex="-1">类型定义</h3>\n<p>组件导出以下类型定义：</p>\n<pre><code class="language-ts"><span class="hljs-keyword">import</span> <span class="hljs-keyword">type</span> { <span class="hljs-title class_">TimePickerProps</span>, <span class="hljs-title class_">TimePickerColumnType</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n</code></pre>\n<p><code>TimePickerInstance</code> 是组件实例的类型，用法如下：</p>\n<pre><code class="language-ts"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> <span class="hljs-keyword">type</span> { <span class="hljs-title class_">TimePickerInstance</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n\n<span class="hljs-keyword">const</span> timePickerRef = ref&lt;<span class="hljs-title class_">TimePickerInstance</span>&gt;();\n\ntimePickerRef.<span class="hljs-property">value</span>?.<span class="hljs-title function_">confirm</span>();\n</code></pre>\n</div><h2 id="chang-jian-wen-ti" tabindex="-1">常见问题</h2>\n<div class="mi-doc-card"><h3 id="zai-zhuo-mian-duan-wu-fa-cao-zuo-zu-jian" tabindex="-1">在桌面端无法操作组件？</h3>\n<p>参见<a href="#/zh-CN/advanced-usage#zhuo-mian-duan-gua-pei" target="_blank">桌面端适配</a>。</p>\n</div>'},null,8,e))}}}]);